## Summary

Refactor the benchmarking infrastructure so that all data processing and badge generation happens during the JMH benchmark execution itself, with shell scripts reduced to only copying/deploying results.

## Problem Statement

Currently:
- Badge generation logic is in shell scripts with hardcoded patterns
- Data processing happens after benchmark execution in non-testable shell scripts  
- Benchmark type detection fails for projects with different class names
- Complex shell scripts are difficult to maintain and test

## Proposed Solution

### 1. Create Common Benchmarking Module with JMH Integration

Create `cui-benchmarking-common` module that integrates with JMH to generate all artifacts during benchmark execution:

```java
public class BenchmarkRunner {
    public static void main(String[] args) throws Exception {
        Options options = new OptionsBuilder()
            .include(BenchmarkOptionsHelper.getInclude())
            .forks(BenchmarkOptionsHelper.getForks())
            .resultFormat(ResultFormatType.JSON)
            .result("target/benchmark-results/raw-result.json")
            .addProfiler(BadgeGeneratorProfiler.class)  // Generate badges during run
            .addProfiler(ReportGeneratorProfiler.class) // Generate HTML reports
            .build();

        Collection<RunResult> results = new Runner(options).run();

        // Post-process results to generate all artifacts
        BenchmarkResultProcessor processor = new BenchmarkResultProcessor();
        processor.processResults(results, "target/benchmark-results");
    }
}
```

### 2. JMH Result Processor with Complete Artifact Generation

```java
public class BenchmarkResultProcessor {

    public void processResults(Collection<RunResult> results, String outputDir) {
        BenchmarkType type = detectBenchmarkType(results);

        // Generate all badges
        BadgeGenerator badgeGen = new BadgeGenerator();
        badgeGen.generatePerformanceBadge(results, type, outputDir + "/badges");
        badgeGen.generateTrendBadge(results, type, outputDir + "/badges");
        badgeGen.generateLastRunBadge(outputDir + "/badges");

        // Generate performance metrics
        MetricsGenerator metricsGen = new MetricsGenerator();
        metricsGen.generateMetricsJson(results, outputDir + "/data");

        // Generate HTML reports with embedded data
        ReportGenerator reportGen = new ReportGenerator();
        reportGen.generateIndexPage(results, outputDir);
        reportGen.generateTrendsPage(results, outputDir);

        // Generate GitHub Pages structure
        GitHubPagesGenerator ghGen = new GitHubPagesGenerator();
        ghGen.prepareDeploymentStructure(outputDir, outputDir + "/gh-pages-ready");

        // Write summary for CI
        writeSummaryFile(results, type, outputDir + "/benchmark-summary.json");
    }

    private BenchmarkType detectBenchmarkType(Collection<RunResult> results) {
        // Smart detection based on package structure, not hardcoded class names
        return results.stream()
            .map(r -> r.getParams().getBenchmark())
            .findFirst()
            .map(benchmark -> {
                if (benchmark.contains(".integration.") || 
                    benchmark.contains(".quarkus.")) {
                    return BenchmarkType.INTEGRATION;
                }
                return BenchmarkType.MICRO;
            })
            .orElse(BenchmarkType.MICRO);
    }
}
```

### 3. Badge Generation During Benchmark Execution

```java
public class BadgeGenerator {

    public void generatePerformanceBadge(Collection<RunResult> results, 
                                         BenchmarkType type, 
                                         String outputDir) {
        PerformanceScore score = calculateScore(results);

        Badge badge = Badge.builder()
            .schemaVersion(1)
            .label(type == BenchmarkType.MICRO ? 
                   "Performance Score" : "Integration Performance")
            .message(formatScore(score))
            .color(getColorForScore(score))
            .build();

        String filename = type == BenchmarkType.MICRO ? 
                         "performance-badge.json" : 
                         "integration-performance-badge.json";

        writeBadgeFile(badge, outputDir + "/" + filename);
    }

    public void generateTrendBadge(Collection<RunResult> results,
                                   BenchmarkType type,
                                   String outputDir) {
        // Load previous results
        PerformanceHistory history = loadHistory(outputDir + "/../history");
        TrendAnalysis trend = analyzeTrend(results, history);

        Badge badge = Badge.builder()
            .schemaVersion(1)
            .label("Performance Trend")
            .message(formatTrend(trend))
            .color(trend.isImproving() ? "brightgreen" : "yellow")
            .build();

        String filename = type == BenchmarkType.MICRO ?
                         "trend-badge.json" :
                         "integration-trend-badge.json";

        writeBadgeFile(badge, outputDir + "/" + filename);
    }
}
```

### 4. Simplified Shell Scripts (Only for Deployment)

```bash
#!/bin/bash
# deploy-benchmark-results.sh - Minimal script just for copying

RESULTS_DIR="benchmark-results"
DEPLOY_DIR="gh-pages"

# All artifacts already generated by Java during benchmark run
if [ -d "$RESULTS_DIR/gh-pages-ready" ]; then
    echo "📦 Deploying pre-generated benchmark artifacts..."
    cp -r "$RESULTS_DIR/gh-pages-ready/*" "$DEPLOY_DIR/"
    echo "✅ Deployment complete"
else
    echo "❌ No benchmark artifacts found. Run benchmarks first."
    exit 1
fi
```

### 5. Maven Configuration

```xml
<plugin>
    <groupId>org.apache.maven.plugins</groupId>
    <artifactId>maven-surefire-plugin</artifactId>
    <configuration>
        <systemPropertyVariables>
            <!-- Configure output directory for all artifacts -->
            <benchmark.output.dir>${project.build.directory}/benchmark-results</benchmark.output.dir>
            <benchmark.generate.badges>true</benchmark.generate.badges>
            <benchmark.generate.reports>true</benchmark.generate.reports>
            <benchmark.generate.github.pages>true</benchmark.generate.github.pages>
        </systemPropertyVariables>
    </configuration>
</plugin>
```

### 6. Testing Infrastructure (Using JUnit Jupiter API)

**Note: Use JUnit Jupiter API for all tests, no Hamcrest matchers**

```java
import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.io.TempDir;
import static org.junit.jupiter.api.Assertions.*;

class BenchmarkResultProcessorTest {

    @Test
    void testCompleteArtifactGeneration(@TempDir Path tempDir) throws Exception {
        // Run mini benchmark
        Options opt = new OptionsBuilder()
            .include(TestBenchmark.class.getSimpleName())
            .warmupIterations(1)
            .measurementIterations(1)
            .forks(1)
            .build();

        Collection<RunResult> results = new Runner(opt).run();

        // Process results
        BenchmarkResultProcessor processor = new BenchmarkResultProcessor();
        String outputDir = tempDir.toString();
        processor.processResults(results, outputDir);

        // Verify all artifacts were created using JUnit Jupiter assertions
        assertTrue(Files.exists(Paths.get(outputDir, "badges/performance-badge.json")));
        assertTrue(Files.exists(Paths.get(outputDir, "badges/trend-badge.json")));
        assertTrue(Files.exists(Paths.get(outputDir, "data/metrics.json")));
        assertTrue(Files.exists(Paths.get(outputDir, "index.html")));
        assertTrue(Files.isDirectory(Paths.get(outputDir, "gh-pages-ready")));

        // Verify badge content
        Badge badge = readBadge(Paths.get(outputDir, "badges/performance-badge.json"));
        assertEquals(1, badge.getSchemaVersion());
        assertNotNull(badge.getLabel());
        assertFalse(badge.getLabel().isEmpty());
        assertNotNull(badge.getMessage());
        assertFalse(badge.getMessage().isEmpty());
        assertTrue(List.of("brightgreen", "green", "yellow", "orange", "red")
                      .contains(badge.getColor()));
    }

    @Test
    void testBenchmarkTypeDetection() {
        String microBenchmark = "de.cuioss.benchmark.core.ValidationBenchmark";
        String integrationBenchmark = "de.cuioss.benchmark.integration.HealthBenchmark";

        assertEquals(BenchmarkType.MICRO, 
                    BenchmarkTypeDetector.detect(microBenchmark));
        assertEquals(BenchmarkType.INTEGRATION, 
                    BenchmarkTypeDetector.detect(integrationBenchmark));
    }

    @Test
    void testPerformanceScoreCalculation() {
        double throughput = 1000000; // ops/sec
        double latency = 0.001; // seconds

        PerformanceScoreCalculator calc = new PerformanceScoreCalculator();
        long score = calc.calculate(throughput, latency);

        assertTrue(score > 0);
        assertEquals(1000000000L, score); // Expected score calculation
    }

    @Test
    void testBadgeGeneration() throws Exception {
        JMHResult result = loadTestResult("sample-benchmark.json");
        BadgeGenerator generator = new BadgeGenerator();
        Badge badge = generator.generatePerformanceBadge(result);

        assertEquals("Performance Score", badge.getLabel());
        assertEquals("brightgreen", badge.getColor());
        assertTrue(badge.getMessage().matches("\\d+ \\(.*ops/s.*\\)"));
    }
}
```

### 7. GitHub Actions Workflow (Simplified)

```yaml
jobs:
  benchmark:
    steps:
      - name: Run Benchmarks (Generates All Artifacts)
        run: |
          # Benchmarks generate everything in target/benchmark-results/
          mvn clean verify -Pbenchmark

      - name: Verify Artifacts Generated
        run: |
          # Verify Java code generated all expected files
          test -d target/benchmark-results/badges
          test -d target/benchmark-results/data  
          test -d target/benchmark-results/gh-pages-ready
          test -f target/benchmark-results/benchmark-summary.json

      - name: Deploy to GitHub Pages
        run: |
          # Simple copy of pre-generated artifacts
          cp -r target/benchmark-results/gh-pages-ready/* ./gh-pages/

      - name: Upload Pages
        uses: actions/upload-pages-artifact@v3
        with:
          path: ./gh-pages
```

## Benefits

1. **Testability**: All logic in Java with full unit test coverage using JUnit Jupiter
2. **Portability**: Works for any project without shell script modifications  
3. **Reliability**: Badge generation happens during benchmark run, not in post-processing
4. **Simplicity**: Shell scripts reduced to simple copy operations
5. **Maintainability**: Single source of truth in Java code
6. **Performance**: No need to re-parse JSON files in shell scripts

## Implementation Steps

1. [ ] Create `cui-benchmarking-common` module with JMH integration
2. [ ] Implement `BenchmarkResultProcessor` with complete artifact generation
3. [ ] Implement `BadgeGenerator` for all badge types
4. [ ] Implement `ReportGenerator` for HTML reports with embedded data
5. [ ] Implement `GitHubPagesGenerator` for deployment structure
6. [ ] Add comprehensive unit tests using JUnit Jupiter API
7. [ ] Create minimal deployment shell script
8. [ ] Update GitHub Actions workflow
9. [ ] Add integration tests that verify end-to-end artifact generation
10. [ ] Update documentation with examples

## Acceptance Criteria

- [ ] Running `mvn verify -Pbenchmark` generates ALL artifacts (badges, reports, data)
- [ ] No post-processing in shell scripts required
- [ ] Badge generation works for any project without modifications
- [ ] All generation logic has unit tests with >90% coverage using JUnit Jupiter
- [ ] CI verifies artifact generation on every build
- [ ] Shell scripts are <50 lines total (just copying files)
- [ ] No Hamcrest dependencies, only JUnit Jupiter API

## Breaking Changes

- Projects will need to update their benchmark runners to use the new processor
- GitHub Actions workflows will be simplified (remove complex shell script processing)
- Output directory structure will be standardized

## Migration Guide

1. Add dependency to `cui-benchmarking-common`
2. Update benchmark runner to use `BenchmarkResultProcessor`
3. Remove shell script processing from GitHub Actions
4. Update deployment to use pre-generated artifacts

